import styled from 'styled-components';

export const LoginContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  .login__form {
    width: 610px;
    background: red;
    border-radius: 5px;
    margin-top: 56px;
    padding: 34px 118px;
    &-heading {
      text-align: center;
    }
  }
`;
